    [],nt"num_tags": 25,nt"name": "annual-narrative-conscience-point-national-wildlife-refuge-1972",nt"isopen":
    false,nt"url": null,nt"notes": "This annual narrative report for Conscience
    Rock National Wildlife Refuge outlines Refuge accomplishments during the 1972 calendar
    year. The report begins by summarizing the weather conditions, habitat conditions,
    water conditions, and food and cover conditions during the year. Wildlife- including
    migratory birds, upland game birds, big game animals, furbearers, rodents, mammals,
    and raptors- is also covered. The Refuge development and maintenance section discusses
    physical developments, vegetation control, and wildfires. The public relations section
    of the report describes recreational uses, Refuge visitors, and violations. Items
    of interest, N-R forms, and photographs are included.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
